import React from 'react'
import './style.scss'
import { USER_AVERAGE_SESSIONS } from '../../data/mocked-data'

export default class Example {
  constructor(data) {
    this.data = data.sessions.day
  }

  formatDataDayAverageSessions() {
    return {
      day: this.data,
    }
  }
}
console.log(USER_AVERAGE_SESSIONS)
const dataApi = USER_AVERAGE_SESSIONS
// console.log(dataApi)
const maClasse = new Example(dataApi)
const maClasseActualisee = maClasse.formatDataDayAverageSessions
console.log(maClasseActualisee)
